B.E5=A.a(s(["Hier lebte die in Amstetten geborene Komponistin und Organistin Maria Francisca Fiederica Hofer (1894-1977). Sie war eingeladen und gef\xf6rdert von der Verlegerin und Gartenbauschul-Gr\xfcnderin Yella Hertzka. Maria Hofer studierte unter anderem bei Rudolf Dittrich, wirkte als Organistin im Wiener Stephansdom und im Dom zu Salzburg. Sie trat als Konzertpianistin, auch mit eigenen Werken, im Wiener Konzerthaus auf. Ihr Werk ist von ihrer katholischen Gl\xe4ubigkeit bestimmt wie von ihrer Virtuosit\xe4t. 1938 zog sie nach Kitzb\xfchel. Als Folge ihrer Mitarbeit in der von Yella Hertzka mitbegr\xfcndeten \u201eInternationalen Frauenliga f\xfcr Frieden und Freiheit in \xd6sterreich\u201c wurde sie mehrmals von der Gestapo verhaftet. Maria Hofer stand nach 1945 bis zu Hertzkas Tod 1948 mit ihr in engem Kontakt.","Hier wurde die Komponistin Lisa Maria Mayer 1894 geboren. Ihr Erfolg als Komponistin von \xfcber 50 Werken ist auch durch die Drucklegung bei der Universaledition dokumentiert. Als konvertierte J\xfcdin in einer Ehe mit dem Nichtjuden Josef Gaberle in Wien geduldet, war sie den Schikanen des NS-Regimes ausgesetzt, durfte weder unterrichten noch auftreten und \xfcberlebte mit schweren gesundheitlichen Beeintr\xe4chtigungen. Von 1945 bis 1948 war Lisa Maria Mayer (1894-1928) am Konservatorium der Stadt Wien angestellt. Der 1888 begr\xfcndete Club der Wiener Musikerinnen in Wien Alsergrund bot ihr zahlreiche Auftrittsm\xf6glichkeiten. Er wurde 1938 aufgel\xf6st.","Valerie Pick, verheiratete Vally Weigl (1894-1982) war eine der Absolventinnen dieser Schule, die einzige, an der eine Matura f\xfcr M\xe4dchen erlaubt war. Nach ihren Studien in Musikwissenschaft und Philosophie an der Universit\xe4t Wien nahm sie auch Kompositionsunterricht bei Karl Weigl, den sie 1921 heiratete. Sie fl\xfcchtete vor dem NS Regime in die USA, ihre Schwester K\xe4the Leichter \xfcberlebte den Holocaust nicht. Vally Weigls Verdienste sind nicht nur zahlreiche Kompositionen f\xfcr Stimme und kleinere Ensembles, sondern auch die Pionierarbeit in Musiktherapie, die sie begann, als sie selbst betroffen nach einer Schulterverletzung war.","Der Verlag, 1919 mit Hilfe von Robert Stolz gegr\xfcndet, bestand bis ins Jahr 1941. 1927 wurde hier, im Wiener Boh\xe8me Verlag, die erste und erfolgreichste Komposition der Hilda L\xf6we (1895-1976) ver\xf6ffentlicht, das Chanson Das alte Lied, das sie f\xfcr Raoul Aslan geschrieben und zu dem Fritz L\xf6hner den Text verfasst hatte. Auf Anraten des Verlags w\xe4hlte die Komponistin f\xfcr die Ver\xf6ffentlichung ein Pseudonym: Henry Love. Unter diesem Namen ver\xf6ffentlichte sie zahlreiche weitere Schlager und Chansons. Sie hatte an der Akademie f\xfcr Musik und darstellende Kunst, damals im Komplex des Wiener Konzerthauses, als Pianistin und Komponistin im Jahr 1914 mit vorz\xfcglichem Erfolg abgeschlossen. Im Wiener Konzerthaus sind zahlreiche Auftritte mit Kammermusik und Chansons dokumentiert.1934 heiratete Hilda Loewe den Wiener B\xfchnenbildner und Maler Joseph Otto Flatter, mit dem sie im selben Jahr nach Gro\xdfbritannien emigrierte.","Die T\xe4nzerin, S\xe4ngerin, Komponistin und Autorin Anita Bild, geborene Lelewer (1915-2012) maturierte am Gymnasium in der Rahlgasse. Nach ihrer Ballettausbildung am Neuen Wiener Konservatorium folgten Engagements an Theatern in Basel, Baden, Wien und Kairo sowie eine Kooperation mit dem Tenor Richard Tauber. Ihre Karriere als T\xe4nzerin wurde 1938 beendet. Sie fl\xfcchtete mit einem Domestic Permit 1939 nach England und konnte wieder als T\xe4nzerin, S\xe4ngerin und Schauspielerin arbeiten. Sie wirkte ab 1950 bei der BBC als Drehbuchautorin und als Leiterin des deutschen Senders. Sie starb 2012 in London.","Hier befand sich von Mitte der 20er Jahre bis zum Bau des Funkhauses die Sendeanlage von Radio Wien in einer ehemaligen Schule. Radio Wien sendete die Lieder der in der NS Zeit vertriebenen Komponistinnen, von Hilda L\xf6we aber auch von Harry Harald, Pseudonym von Hilda Geiringer. Diese Hilda Geiringer, geboren 1898, alias Harry Harald, ging 1938 ins Exil nach London und emigrierte 1940 weiter nach Pennsylvania, wo sie auch 1977 starb.","Camilla Frydan, eigentlich Camilla Herzl, Pseudonym Camilla Herzer (1887-1949), hatte Klavier, Harmonielehre und Komposition am Konservatorium der Gesellschaft der Musikfreunde studiert. Im Alter von f\xfcnf Jahren gab sie ihr erstes Konzert im Wiener Ehrbar-Saal. Sie wirkte als Dirigentin und S\xe4ngerin ihrer Werke, war Textdichterin und Co-Autorin des Prominenten Almanachs. Sie trat nicht nur im Etablissement Simpl auf, sondern auch im Kabarett Fledermaus, oft gemeinsam mit ihrem Schwager Egon Friedell, mit Peter Altenberg oder Alfred Polgar. Sie fl\xfcchtete 1938 ins Exil in die USA, wo sie 1945 einen eigenen Verlag gr\xfcndete.","Josefine Winter, Edle von Wigmar (1873-1943) war Malerin, Komponistin und Schriftstellerin. Nach privaten Studien wurde sie 1903 Studentin von Josef Bohuslav Foerster am Neuen Wiener Konservatorium. In erster Ehe wohnte sie hier mit Alfred Fr\xf6hlich von Feldau, in zweiter Ehe mit dem Dichter Josef von Winter. Sie komponierte vor allem Lieder. Josefine Winter von einer Sammelwohnung im zweiten Bezirk im Jahr 1942 ins KZ Theresienstadt deportiert und 1943 dort ermordet. Vertrieben aus ihrer Villa im W\xe4hringer Cottage vers\xe4umte sie die M\xf6glichkeit, die sie dank ihres Verm\xf6gens und ihres Netzwerkes gehabt h\xe4tte, ins Exil zu gehen. Sie z\xf6gerte zu lange und erlebte die Arisierung ihres Verm\xf6gens und die Deportation."]),t.s)
